INSERT INTO `magazineinfo` (`mag_id`, `mag_name`, `category`, `price_per_issue`, `weight_per_issue`, `cover_pic`, `description`, `issue_per_month`, `status`, `price_three_months`, `price_six_months`, `price_nine_months`, `price_twelve_months`) VALUES
(20, 'Time Magazine', 'Business & Finance', '2', '0.5', 'images/magazines/Time.jpg', 'Time is the world''s largest circulation weekly news magazine with a readership of 25 million, of which 20 million are in the US.', 4, 'in stock', '20', '30', '40', '45'),
(22, 'TV GUIDE MAGAZINE', 'Business & Finance', '23', '1.5', 'images/magazines/TvGuide.jpg', 'TV Guide magazine is now full-size & full-color for people who are passionate about their favorite shows, characters & stars. TV Guide now includes an easier-to-use national listings section with more highlights & reviews. TV Guide publishes 19 double issues a year that count as 2 regular issues.', 1, 'in stock', '40', '50', '60', '70'),
(23, 'MEN''S HEALTH', 'Men''s', '1.5', '1.1', 'images/magazines/menhealth.jpg', 'Men''s Health magazine offers information to help men look good, feel great and take control of their lives. Each issue of Men''s Health magazine features articles on fitness, health, career, relationships, nutrition, sex and general interests.', 4, 'in stock', '25', '40', '55', '70'),
(24, 'SLAM', 'Business & Finance', '9.9', '1', 'images/magazines/slam.jpg', 'Slam magazine is written for basketball players, fans and enthusiasts ages of 14 to 24. Slam magazine cover pro, college, high school and playground basketball and features player profiles and interviews, basketball fashions and lifestyles.', 1, 'in stock', '30', '50', '70', '90'),
(25, 'Instyle', 'Women''s', '2.6', '1.2', 'images/magazines/Instyle.jpg', 'InStyle magazine celebrates the private side of public faces, revealing the personal style choices of the world''s most fascinating people. InStyle magazine is a trusted source for the latest trends in beauty, fashion, home entertaining and much more.', 4, 'in stock', '10', '15', '20', '25'),
(28, 'NEWSWEEK', 'Business & Finance', '4', '0.7', 'images/magazines/Newsweek.jpg', 'Newsweek magazine brings readers the latest news of the world. Newsweek magazine has a heavy emphasis on political, business and international news stories with some lighter stories included each week.', 4, 'in stock', '15', '20', '25', '30'),
(29, 'THE ECONOMIST', 'Business & Finance', '18.8', '1.2', 'images/magazines/the Economist.jpg', 'The Economist is a global weekly magazine. Each issue of The Economist explores domestic and international issues, business, finance, current affairs, science, technology and the arts.', 1, 'in stock', '35', '50', '65', '80'),
(30, 'Forbes', 'Business & Finance', '200', '1.5', 'images/magazines/Forbes.jpg', 'Forbes magazine provides the most recent news about trends and developments in global business, financial markets and personal finance. Forbes magazine is known for its lists like the "200 Best Small Companies" and "100 Top Celebrities."', 1, 'in stock', '0', '0', '0', '0');
